-- create user 'icsdiscover'@'localhost' identified with mysql_native_password by 'icsdiscover';
create database if not exists icsdiscover;
grant all privileges on icsdiscover.* to 'icsdiscover'@'localhost' with grant option;

-- Use the database
use icsdiscover;

-- Drop all tables if exists in the correct sequence
drop table if exists users;

-- Create the registered user table
 create table users (
   _id int auto_increment not null, 
   username varchar(50) primary key not null, 
   password varchar(255) not null,
   first_name varchar(30) not null,
   last_name varchar(30) not null,  
   age integer not null,
   salary decimal(15, 2) not null,
   authorities varchar(15) not null default 'ROLE_USER',
   created_date datetime not null default current_timestamp,
   created_by varchar(90) not null,
   last_updated_date datetime not null default current_timestamp,
   last_updated_by varchar(90) not null,
   UNIQUE (_id)
);

